import RowWithDots from "./row_with_dots";
import RowWithVerticalLines from "./row_with_vl";

class Board extends React.Component {

    constructor (props) {
        super(props);
    }

    render () {
        return (
            <div className="board">
                <table>
                    <RowWithDots/>
                    <RowWithVerticalLines/>
                    <RowWithDots/>
                    <RowWithVerticalLines/>
                    <RowWithDots/>
                    <RowWithVerticalLines/>
                    <RowWithDots/>
                </table>
            </div>
        );
    }

}

export default Board;
